import { useState } from "react";
import propTypes from  "prop-types"
import PropTypes from "prop-types";

// style objects
const containerStyle={
    display:'flex',
    alignItems:'center',
    gap:"16px",
};

const starContainerStyle={
    display:"flex",
    gap:"4px",
};


StarRating.propTypes={
    maxRating:PropTypes.number,
    defaultRating:PropTypes.number,
    color:PropTypes.string,
    size:PropTypes.number,
    messages:PropTypes.array,
    className:PropTypes.string,
    onset:PropTypes.func,
}


// her we are pasing the default
export default function StarRating({maxRating= 5,
    color='#fcc419',
    size=48,
    className="",
    messages=[],
    defaultRating=0,
    onSet,
}
){

const [rating,setRating]=useState(defaultRating)  ;

const [tempRating,setTempRating]=useState(0)

function handleRating(rating){
    console.log(rating)
    setRating(rating);
    onSet(rating);
}

const textStyle={
    lineHeight:"0",
    margin:'0',
    color,
    fontSize:`${size/1.5}px`

}




    return (
        <div style={containerStyle} className={className}>
            <div style={starContainerStyle}>
                {/* stars */}
                {Array.from( {length:maxRating},(_, i)=> (

                    <Star key={i} 
                    onRate={()=>handleRating(i+1)}
                    onHoverIn={()=>setTempRating(i+1)}
                    onHoverOut={()=>setTempRating(0)}
                    full={tempRating? tempRating >=i+1 :rating >= i+1}
                    color={color}
                    size={size}

                    />
                )
            )}
            </div>

            {/* message */}
            <p style={textStyle}>{messages.length === maxRating ?messages[tempRating ? tempRating -1 :rating-1]:tempRating ||rating|| ""}</p>

        </div>
    )

}

function Star({onRate,full,onHoverIn,onHoverOut,color,size}){


const starStyle={
    width:`${size}px`,
    height:`${size}px`,
    display:'block',
    cursor:'pointer',
};

    return(
        // this role is for html accessibility  bcz we want the click functionality to this span
<span role='button' style={starStyle} onClick={onRate} 
 onMouseEnter={onHoverIn}
 onMouseLeave={onHoverOut}
>

    {/* consitional rendering f the full star  and empty star */}
{ full ?
    (
        <svg
    xmlns="http://www.w3.org/2000/svg"
    viewBox="0 0 20 20"
    fill={color}
    stroke={color}
  >
    <path
